import * as React from 'react';

export const ControlHostCard = () => {
  return (
    <div className='w-1/2'>
      <div>svg here</div>
      <div>
        <h3 style={{ fontFamily: 'airbnb-bold' }} className='text-2xl'>
          Host whenever you want
        </h3>
      </div>
      <div>
        <p>
          There’s no minimum or mandatory time you have to host, so you can
          block off dates when you’re not available. You can also set rules
          about your availability, including: • Min/max nights a guest can stay
          • How far in the future guests can book • Advance notice needed before
          a booking
        </p>
      </div>
    </div>
  );
};
